import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Heading from './Heading';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
  <Heading />
    <p>This is my world</p>
    <ol>
      <li>Mohit </li>
      <li>Suraj</li>
      <li>Arion</li>
      <li>Sahil</li>
    </ol>
  </>
);
